import "./App.css";
import React , { useState } from "react";

function App() {
  let [count, setCount] = useState(0);

  function inc()
  {
    return setCount(count++)
  }
  return (
    <div className="App">
      <div className="cardblock">

        <h1>{count}</h1>
        <button onClick={inc}>Click me</button>

      </div>
    </div>
  );
}

export default App;
